INSERT INTO `v1_55a0fec58ab72ad5029e46044a4d7e946ba7eeef41a69983a7d706f38af4102a` VALUES (2, 1000, "調子が上がって\nきたなっ", 1, "vo_minigame_1013_icon_2_002_001", 2, "vo_minigame_1013_icon_1_002_001", 2, 3000, "訓練はまだ\nここからですわ");
INSERT INTO `v1_55a0fec58ab72ad5029e46044a4d7e946ba7eeef41a69983a7d706f38af4102a` VALUES (2, 5000, "ほらほら、\nまだいけるだろ？", 2, "vo_minigame_1013_icon_2_003_001", 2, "vo_minigame_1013_icon_1_003_001", 2, 3000, "クスクス、悪くない\n流れですわね");
INSERT INTO `v1_55a0fec58ab72ad5029e46044a4d7e946ba7eeef41a69983a7d706f38af4102a` VALUES (3, 10000, "へへっ、おまえら\nやるじゃねえか！", 3, "vo_minigame_1013_icon_2_004_001", 2, "vo_minigame_1013_icon_1_004_001", 2, 3000, "すばらしい\n記録ですわ");
INSERT INTO `v1_55a0fec58ab72ad5029e46044a4d7e946ba7eeef41a69983a7d706f38af4102a` VALUES (3, 10000, "あたしたちはまだ\n止まらねえぜ！", 4, "vo_minigame_1013_icon_2_005_001", 2, "vo_minigame_1013_icon_1_005_001", 3, 3000, "乗りに乗って\nいますわね");
INSERT INTO `v1_55a0fec58ab72ad5029e46044a4d7e946ba7eeef41a69983a7d706f38af4102a` VALUES (3, 10000, "見てろよ！\nマコト班の快進撃だ！", 5, "vo_minigame_1013_icon_2_005_002", 2, "vo_minigame_1013_icon_1_005_002", 3, 3000, "まだまだ行きます\nついてきなさい");
INSERT INTO `v1_55a0fec58ab72ad5029e46044a4d7e946ba7eeef41a69983a7d706f38af4102a` VALUES (3, 10000, "うおぉぉっ！\n絶好調だぜ！", 6, "vo_minigame_1013_icon_2_005_003", 2, "vo_minigame_1013_icon_1_005_003", 3, 3000, "エリコ班の\n本領発揮ですわ！");
INSERT INTO `v1_55a0fec58ab72ad5029e46044a4d7e946ba7eeef41a69983a7d706f38af4102a` VALUES (3, 0, "どこまで行けるか\n楽しみだなっ！", 7, "vo_minigame_1013_icon_2_006_001", 2, "vo_minigame_1013_icon_1_006_001", 4, 3000, "ここからは\n前人未到の領域です！");
INSERT INTO `v1_55a0fec58ab72ad5029e46044a4d7e946ba7eeef41a69983a7d706f38af4102a` VALUES (4, 1, "まだ諦めんなよっ", 8, "vo_minigame_1013_icon_2_007_001", 3, "vo_minigame_1013_icon_1_007_001", 5, 1000, "厄介でしたわ…");
INSERT INTO `v1_55a0fec58ab72ad5029e46044a4d7e946ba7eeef41a69983a7d706f38af4102a` VALUES (4, 1, "冷やっとしたぜ…！", 9, "vo_minigame_1013_icon_2_007_002", 3, "vo_minigame_1013_icon_1_007_002", 5, 1000, "油断大敵です");
INSERT INTO `v1_55a0fec58ab72ad5029e46044a4d7e946ba7eeef41a69983a7d706f38af4102a` VALUES (4, 1, "弱音を吐くなっ", 10, "vo_minigame_1013_icon_2_007_003", 3, "vo_minigame_1013_icon_1_007_003", 5, 1000, "忌々しいっ…");
INSERT INTO `v1_55a0fec58ab72ad5029e46044a4d7e946ba7eeef41a69983a7d706f38af4102a` VALUES (3, 99, "マコト班集合！", 11, "vo_minigame_1013_icon_2_008_001", 4, "vo_minigame_1013_icon_1_008_001", 6, 1500, "大所帯ですわね");
INSERT INTO `v1_55a0fec58ab72ad5029e46044a4d7e946ba7eeef41a69983a7d706f38af4102a` VALUES (3, 99, "連携してくぞ！", 12, "vo_minigame_1013_icon_2_008_002", 4, "vo_minigame_1013_icon_1_008_002", 6, 1500, "エリコ班へようこそ");
INSERT INTO `v1_55a0fec58ab72ad5029e46044a4d7e946ba7eeef41a69983a7d706f38af4102a` VALUES (6, 0, "みんなに力を！", 13, "vo_minigame_1013_icon_2_020_001", 1, "vo_minigame_1013_icon_1_020_001", 8, 3000, "ナナカちゃんに\nお任せあれ");
INSERT INTO `v1_55a0fec58ab72ad5029e46044a4d7e946ba7eeef41a69983a7d706f38af4102a` VALUES (7, 0, "任せてくれたまえ", 14, "vo_minigame_1013_icon_2_022_001", 1, "vo_minigame_1013_icon_1_022_001", 9, 3000, "はっはっは！\n任せろ！");
INSERT INTO `v1_55a0fec58ab72ad5029e46044a4d7e946ba7eeef41a69983a7d706f38af4102a` VALUES (8, 0, "ほな、いきまひょか", 15, "vo_minigame_1013_icon_2_023_001", 1, "vo_minigame_1013_icon_1_023_001", 10, 3000, "どんどんいくわよ");
